import org.datasyslab.geosparksql.utils._
import org.datasyslab.geospark.enums.{FileDataSplitter, GridType, IndexType}
import org.datasyslab.geospark.spatialOperator._
import org.datasyslab.geospark.spatialRDD._

// Zeppelin creates and injects sc (SparkContext) and sqlContext (HiveContext or SqlContext)
// So you don't need create them manually

// Load data
GeoSparkSQLRegistrator.registerAll(spark)
GeoSparkVizRegistrator.registerAll(spark)

// Load Long Lat from a CSV file: Area landmark
var pointdf = spark.read.format("csv").option("delimiter", ",").option("header", "false").load("/home/ubuntu/data/arealm.csv")
pointdf.createOrReplaceTempView("area_landmark")
spark.sql("CREATE OR REPLACE TEMP VIEW area_landmark AS SELECT cast(_c0 as Decimal(24,20)) as lon, cast(_c1 as Decimal(24,20)) AS lat FROM area_landmark")
spark.table("area_landmark").show()

// Load WKT format file: USA county
var polygondf_wkt = spark.read.format("csv").option("delimiter", "\t").option("header", "false").load("/home/ubuntu/data/county_small.tsv")
polygondf_wkt.createOrReplaceTempView("county_wkt")
polygondf_wkt.show()

// GeoSpark RDD Join Query API usually has a better performance than DataFrame / SQL Join API
// Mix GeoSpark RDD and DataFrame API to have a more concrete example
val pointrdd = Adapter.toSpatialRdd(spark.table("area_landmark"), "shape")
// Comput the statistics, such as count and dataset boundary
pointrdd.analyze()

val polygonrdd = Adapter.toSpatialRdd(spark.table("county_wkt"), "shape")
// Comput the statistics, such as count and dataset boundary
polygonrdd.analyze()

// Run spatial partitioning. Use the pointRDD to build the partitioning file
// Apply the same partitioning file to both RDDs
pointrdd.spatialPartitioning(GridType.KDBTREE)
polygonrdd.spatialPartitioning(pointrdd.getPartitioner)

// Build Spatial index on one of the spatial RDD. This can be the pointRDD
pointrdd.buildIndex(IndexType.QUADTREE, true)

// Run the spatial join query
val joinResultPairRDD = JoinQuery.SpatialJoinQueryFlat(pointrdd, polygonrdd, true, false)

// Bring the join result back to DataFrame
import scala.collection.JavaConverters._
val joinResultDf = Adapter.toDf(joinResultPairRDD, polygonrdd.fieldNames.asScala.toList, pointrdd.fieldNames.asScala.toList, spark)

joinResultDf.show()

// Mix GeoSpark RDD and DataFrame API to have a more concrete example
// Distance join query API in RDD
// Area landmarks with 100 km of each county
// This requires CRS transformation which is omitted here
val pointrdd = Adapter.toSpatialRdd(spark.table("area_landmark"), "shape")
// Comput the statistics, such as count and dataset boundary
pointrdd.analyze()

val polygonrdd = Adapter.toSpatialRdd(spark.table("county_wkt"), "shape")
// Create the distance buffer
var circleRDD = new CircleRDD(polygonrdd, 1000000)
// Comput the statistics, such as count and dataset boundary
circleRDD.analyze()

// Run spatial partitioning. Use the pointRDD to build the partitioning file
// Apply the same partitioning file to both RDDs
pointrdd.spatialPartitioning(GridType.KDBTREE)
circleRDD.spatialPartitioning(pointrdd.getPartitioner)

// Build Spatial index on one of the spatial RDD. This can be the pointRDD
pointrdd.buildIndex(IndexType.QUADTREE, true)

// Run the distance join query
val joinResultPairRDD = JoinQuery.DistanceJoinQueryFlat(pointrdd, circleRDD, true, false)

// Bring the join result back to DataFrame
import scala.collection.JavaConverters._
val joinResultDf = Adapter.toDf(joinResultPairRDD, polygonrdd.fieldNames.asScala.toList, pointrdd.fieldNames.asScala.toList, spark)

joinResultDf.show()
